//不随机优化不给过
class Solution {
    public int[] sortArray(int[] nums) {
        qsort(nums,0,nums.length-1);
        return nums;
    }
    public void qsort(int[] nums,int left,int right){
        if(left>=right)
            return;
        int il=left,ir=right;
        int i = new Random().nextInt(right - left + 1) + left; // 随机选一个作为我们的主元
        int tmp = nums[i];
        nums[i] = nums[left];
        nums[left] = tmp;
        int pivot = nums[left];
        while (left<right){
            while (left<right && nums[right]>=pivot)
                --right;
            if(left == right)
                break;
            nums[left] =nums[right];
            while (left<right && nums[left]<=pivot)
                ++left;
            if(left == right)
                break;
            nums[right]=nums[left];
        }
        nums[left] = pivot;
        qsort(nums,il,left-1);
        qsort(nums,left+1,ir);
    }
}